import React from "react";
import "bulma/css/bulma.min.css";

export default function Navigation() {
return (
  <div>
    <div id="aboutMe" className="is-flex-direction-row">
      {/* title and picture */}
      <div className="is-flex-direction-column is-two-fifths">
        {/* title */}
        <div>
          <h1>About Me</h1>
        </div>
        {/* picture */}
        <div></div>
      </div>
      {/* actual info */}
      <div className="is-three-fifths">
        Georgia Tech bootcamp student, went to school for biology, like front
        end development, like to read, workout, travel, the color pink
      </div>
    </div>
    {/* portfolio section */}
    <div>
      {/* title */}
      <div>
        <h1>Portfolio</h1>
      </div>
      {/* 6 cards */}
      <div>
        <div></div>
        <div></div>
        <div></div>
        <div></div>
        <div></div>
        <div></div>
      </div>
    </div>
    {/* contact form */}
    <div>
      {/* title */}
      <div>Contact</div>
      {/* form */}
      <div></div>
    </div>
  </div>
);

}
